    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on San Andres NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how San Andres NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, a summary of Refuge resources, legal
    policies, and current management programs. Key planning issues include: biological
    diversity, public use, interagency relationships, cultural resources, and staffing.",nt"license_title":
